import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { Provider } from "react-redux";
import storeOfslices from "./components/store/storeOfSlices";

ReactDOM.render(
  <Provider store={storeOfslices}>
    <App> </App>
  </Provider>,
  document.getElementById("root")
);
